import React from 'react';
import { FaUserAlt, FaShoppingCart, FaHeart, FaHeartBroken } from 'react-icons/fa';


function Header() {
  // Import result is the URL of your image
  return  <div style={{ display: 'flex', justifyContent: 'flex-end'}}>
      <h2><FaUserAlt />
        <FaShoppingCart />
        <FaHeart />
        <FaHeartBroken />

      </h2>

  </div>

  
   
}

export default Header;
